create table ordini (
    id           int auto_increment
        primary key,
    utente       int                                not null,
    destinazione varchar(100)                       not null,
    momento      datetime default CURRENT_TIMESTAMP not null,
    constraint ordini_ibfk_1
        foreign key (utente) references utenti (id)
            on update cascade
);

create index utente
    on ordini (utente);

